window.bookSummaryJSON = "<p>Lucifer Morningstar took everything from me. My memories. My freedom. My powers. Now it’s my turn to take everything from him.</p> <p>I’ll make alliances with former enemies. I’ll hunt those who betrayed me. And I’ll make my grandfather regret ever learning of my existence.</p> <p>As Samael prepares for war, I’m learning there’s nothing I wouldn’t do to protect those I love. And this is our chance to free the underworld from Lucifer’s evil.</p> <p>The underking thinks he can hold me prisoner in his castle. But he’s about to learn why he should have guarded his world from me.</p> <p>Because I’m going to burn that world down.</p> <p>Even if I burn with it.</p> <p>If you like K.F. Breene, Ilona Andrews, Patricia Briggs, Faith Hunter, Laurell K. Hamilton, Jennifer Estep, Shannon Mayer, Kim Harrison, and Dannika Dark, you’ll love this series. The Deals with Demons world includes the fae, demons, mages, werewolves, witches, and more.</p> <p>Listen to it now.</p>"; 
